import React, { Component } from 'react'
import { TrainerConsumer } from './TrainerInfo'

export default class Trainer extends Component {
  render() {
    return (
      <TrainerConsumer>
        {
            value=>{
                return(
                    <div>
                        <center></center>
                      <h1>Trainer Info</h1>
                      <hr></hr>
                      <br></br>
                      <h4>{value.id}</h4>
                      <br></br>
                      <br></br>
                      <h4>{value.age}</h4>
                      <br></br>
                      <br></br>
                      <h4>{value.course}</h4>
                      <br></br>
                      <br></br>
                      <h4>{value.package1}</h4>
                      <br></br>
                    </div>
                )
            }
        }
      </TrainerConsumer>
    )
  }
}
